import{_ as a,o as e,c as t,e as r}from"./chunks/framework.mYMQfzZG.js";const o="/assets/500-23158369f95976b96151fdc7024cb6a0.BkehEyyj.jpg",s="/assets/500-6290a9a41bd6390c41ec12bfb1ae5aa4.JzmEtSxd.jpg",i="/assets/500-ff27f8b9a38ebeec682dcc84abd2da0c.vcM-cbBA.jpg",q=JSON.parse('{"title":"НАТУРА МЕСТО","description":"Студия","frontmatter":{"title":"НАТУРА МЕСТО","description":"Студия","date":"2018-12-06","cover":"STfBs3wIVqo.jpg","address":"ул. Малая Семеновская д 3а, стр 1","place":"м. Электрозаводская","city":"г. Москва","email":"naturamesto@mail.ru","url":"https://natura-mesto.ru","tel":"+7 (926) 281-49-01","facebook":"naturamesto","vk":"natura_mesto","instagram":"natura_mesto","status":"closed","coord":[55.785541166481195,37.70591099867569]},"headers":[],"relativePath":"workshop/archive/natura-mesto/index.md","filePath":"workshop/archive/natura-mesto/index.md"}'),h={name:"workshop/archive/natura-mesto/index.md"},n=r('<h2 id="место-человека-и-его-дела" tabindex="-1">Место человека и его дела <a class="header-anchor" href="#место-человека-и-его-дела" aria-label="Permalink to &quot;Место человека и его дела&quot;">​</a></h2><h3 id="студия-для-мастер-классов-курсов-фото-и-видео-съемок" tabindex="-1">СТУДИЯ ДЛЯ МАСТЕР-КЛАССОВ, КУРСОВ, ФОТО И ВИДЕО СЪЕМОК <a class="header-anchor" href="#студия-для-мастер-классов-курсов-фото-и-видео-съемок" aria-label="Permalink to &quot;СТУДИЯ ДЛЯ МАСТЕР-КЛАССОВ, КУРСОВ, ФОТО И ВИДЕО СЪЕМОК&quot;">​</a></h3><h4 id="даваите-знакомиться" tabindex="-1">Давайте знакомиться <a class="header-anchor" href="#даваите-знакомиться" aria-label="Permalink to &quot;Давайте знакомиться&quot;">​</a></h4><p>Мы Аня и Даша. А это наше место - студия с тремя залами для мастер-классов, курсов, тренингов, фото и видеосъемок. В нашей команде два чудесных администратора - Саша и Ксюша. Они внимательные, обаятельные и энергичные. Это место мы создали для себя и для людей-единомышленников, у которых уже есть свое дело. Мы хотим, чтобы вы тоже почувствовали его своим. Чтобы могли растить здесь свой проект. Проводить предметные съемки своего продукта, снимать видео-истории, организовывать встречи, завтраки, презентации, воркшопы для своих гостей. Мы создавали его так, чтобы вы и ваши гости были в восторге от атмосферы, уюта и чистоты.</p><h2 id="в-нашеи-студии-3-зала" tabindex="-1">В НАШЕЙ СТУДИИ 3 ЗАЛА <a class="header-anchor" href="#в-нашеи-студии-3-зала" aria-label="Permalink to &quot;В НАШЕЙ СТУДИИ 3 ЗАЛА&quot;">​</a></h2><p><img src="'+o+'" alt=""></p><h3 id="дубовыи-зал" tabindex="-1">ДУБОВЫЙ ЗАЛ <a class="header-anchor" href="#дубовыи-зал" aria-label="Permalink to &quot;ДУБОВЫЙ ЗАЛ&quot;">​</a></h3><p>10 ЧЕЛОВЕК | 50 кв м Хороший дневной свет, большие окна, фотозона с лавочкой и журнальным столиком. Вместимость 10 участников + 2 организатора. Подходит для мастер-классов, фото и видеосъемок без записи звука</p><p><img src="'+s+'" alt=""></p><h3 id="белыи-зал" tabindex="-1">БЕЛЫЙ ЗАЛ <a class="header-anchor" href="#белыи-зал" aria-label="Permalink to &quot;БЕЛЫЙ ЗАЛ&quot;">​</a></h3><p>10 ЧЕЛОВЕК | 30 кв м Расположен на втором ярусе студии. Вместимость 10 участников + 2 организатора. Удален от окна, поэтому для съемок не рекомендуем. Подходит для мастер-классов, тренингов, консультаций, рабочих встреч</p><p><img src="'+i+'" alt=""></p><h3 id="деревянныи-зал" tabindex="-1">ДЕРЕВЯННЫЙ ЗАЛ <a class="header-anchor" href="#деревянныи-зал" aria-label="Permalink to &quot;ДЕРЕВЯННЫЙ ЗАЛ&quot;">​</a></h3><p>8 ЧЕЛОВЕК | 20 кв м Хороший дневной свет, большие окна, изолирован. Вместимость 8 участников + 2 организатора. Подходит для предметных и портретных съемок, видеосъемок с записью звука, мастер-классов, курсов, занятий, требующих изоляции, с использованием шумных приборов или пахучих материалов</p><h3 id="что-у-нас-проводят" tabindex="-1">ЧТО У НАС ПРОВОДЯТ <a class="header-anchor" href="#что-у-нас-проводят" aria-label="Permalink to &quot;ЧТО У НАС ПРОВОДЯТ&quot;">​</a></h3><p>Мы принимаем только рабочие, творческие, спокойные форматы для взрослых гостей. Вечеринки и детские мероприятия у нас не проходят. Поддерживаем атмосферу в студии, чтобы всем нашим гостям было приятно и комфортно работать.</p><h3 id="красота-и-порядок" tabindex="-1">Красота и порядок. <a class="header-anchor" href="#красота-и-порядок" aria-label="Permalink to &quot;Красота и порядок.&quot;">​</a></h3><h5 id="в-жизни-как-на-фото" tabindex="-1">В жизни как на фото <a class="header-anchor" href="#в-жизни-как-на-фото" aria-label="Permalink to &quot;В жизни как на фото&quot;">​</a></h5><p>Мы каждый день следим за чистотой и порядком. Стараемся поддерживать залы в идеальном состоянии. Для этого у нас есть чек-листы, по которым мы делаем уборку и ставим каждую кружку, книгу, свечу четко на свое место. В жизни все выглядит также как на фото, иногда немного меняем детали. Каждый месяц мы улучшаем интерьер. Добавляем деталей для красоты и удобства. Вы можете приехать на просмотр, чтобы увидеть всё своими глазами. Большинство наших гостей становятся постоянными и больше не ищут другие площадки, потому что у нас действительно все красиво, чисто, в команде приятные девочки, и мы четко работаем.</p><h5 id="все-для-красивого-кофе-бреика" tabindex="-1">ВСЕ ДЛЯ КРАСИВОГО КОФЕ-БРЕЙКА <a class="header-anchor" href="#все-для-красивого-кофе-бреика" aria-label="Permalink to &quot;ВСЕ ДЛЯ КРАСИВОГО КОФЕ-БРЕЙКА&quot;">​</a></h5><p>В каждом зале есть зона для кофе-брейка со всей необходимой посудой: стаканы для чая/кофе, тарелки, чаши для угощений, кулер с гор/хол водой. Для каждого мероприятия мы бесплатно предоставляем мини-набор для кофе-брейка: чай, сахар, палочки для размешивания, салфетки. В продаже есть хороший кофе, который вы можете заказать на группу или ваши гости могут приобрести его сами, по желанию. Вам остается только привезти угощения.</p>',21),c=[n];function l(d,p,u,m,_,b){return e(),t("div",null,c)}const k=a(h,[["render",l]]);export{q as __pageData,k as default};
